// Nav.js
import React from 'react';
import { Link } from 'react-router-dom';

function Nav() {
  return (
    <nav>
      <Link to="/">Home</Link>
      <Link to="/specials">Specials</Link>
      <Link to="/booking">Booking</Link>
    </nav>
  );
}

export default Nav;
